import React from 'react';
import Header from '../components/Header';
import './Contact.css';

const Contact = () => {
    return (
        <div>
            <Header />
        <section>
        <h1>Contact-Us</h1>
         <ul>
         <li>Business Name: Blizzards</li>
         <li>Address: blah</li>
         <li>Number: none</li>
         <li>Location: None</li>
         </ul>
        </section> 
        </div>
    )
}

export default Contact
